import React, { useState } from 'react'
import axios from "axios"

export default function Login() {
    const [password , setPassword] = useState("")
    const [userName , setUserName] = useState("")
    const hendleSubmit = async (e)=>{
        e.preventDefault();
        axios.post("https://66df4226de4426916ee4127f.mockapi.io/api/login/user" , {
             userName, password
        }).then(req => console.log(req))
        .catch((err)=> console.log(err.message))
        
    }
  return (
    <div className='d-flex justify-content-center align-items-center' style={{height:"100vh"}}> 
<form className='w-50' onSubmit={hendleSubmit}>
    <label htmlFor="userName"> userName</label>
    <input type="text"className='form-control w-100' placeholder='userName'  id='userName' required  value={userName}  onChange={(e)=> setUserName(e.target.value)}    />
<br />
<label htmlFor="password">password</label>
<input type="password" className='w-100 form-control' placeholder='password' id='password' required value={password} onChange={(e)=> setPassword(e.target.value)}/>

<br />
<button type='submit' className='btn btn-success'>send </button>



</form>






    </div>
  )
}
